def print_hex_matrix(hex_string):
    hex_values = hex_string.split()
    matrix_size = 10
    num_values = len(hex_values)
    matrix_count = num_values // (matrix_size * matrix_size)
    
    for matrix_index in range(matrix_count):
        matrix_start = matrix_index * matrix_size * matrix_size
        matrix_end = (matrix_index + 1) * matrix_size * matrix_size
        matrix = [hex_values[i:i+matrix_size] for i in range(matrix_start, matrix_end, matrix_size)]
        for row in matrix:
            emoji_row = ['⬛️' if value == '0x01' else '⬜️' for value in row]
            print(''.join(emoji_row))
        print()  # Espacio entre matrices

    # Imprimir los valores restantes que no forman una matriz completa
    remaining_values = num_values % (matrix_size * matrix_size)
    if remaining_values > 0:
        remaining_matrix = [hex_values[matrix_end:matrix_end+remaining_values]]
        emoji_row = ['⬛️' if value == '0x01' else '⬜️' for value in remaining_matrix[0]]
        print(''.join(emoji_row))


